import React from 'react';
import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Projects from './components/Projects/ProjectUI';
import Particles from 'react-particles-js';
import particlesConfig from './Particles/configParticles';

function App() {
  return (
    <div className="App" >
       <h1>HELLO WORLD</h1>

      <Particles className='particles' params={particlesConfig} />
      <Projects />
  </div>
  );
}

export default App;
